import matplotlib.pyplot as plt

#  data 
# data = [12, 45, 78, 12, 255, 0, 128, 128, 128, 200, 45, 45, 0, 1, 2, 3, 4, 5, 6] * 10

def plot_histogram(data, title="Value Histogram", save_path=None):
    """
    data: list of integers in [0,255]
    title: 
    save_path:  None .png/.jpg 
    """
    #  0255  256 
    bins = list(range(257))  # [0,1,2,...,256]
    
    plt.figure(figsize=(8, 4))
    plt.hist(data, bins=bins, color='steelblue', edgecolor='black')
    plt.title(title)
    plt.xlabel("Value (0255)")
    plt.ylabel("Frequency")
    plt.xlim(0, 255)
    
    # 
    plt.grid(axis='y', alpha=0.3)
    
    # 
    if save_path:
        plt.tight_layout()
        plt.savefig(save_path, dpi=150)
        print(f"Saved histogram to {save_path}")
    else:
        plt.show()

if __name__ == "__main__":
    # 
    plot_histogram(data, title="Sample Data Histogram")

